import React, { Component } from 'react';

import './App.css';
import '../index.css';

class App extends Component {
  constructor() {
    super()
    this.state = {
      page: 'Introduction',
      isWaiting: true
    }
  }

  componentDidMount() {
    setTimeout(() => {
      this.setState({isWaiting:false})
    },3000)
  }

  render() {
    if (this.state.isWaiting === true) {
      setTimeout(() => this.setState({isWaiting:false}),100000)
      return <button> </button>
    }
  }
}

export default App;
